import { Route, Routes, Navigate } from "react-router-dom";
import Login from "./components/Authentication/Login";

function App() {
  return (
      <Routes>
        <Route path="/" element={<Navigate replace to="/login" />} />
        <Route path="/login" element={<Login />} />
      </Routes>
  );
}

export default App;
